source_code:
**Marges:** Aanwijzingen voor de drukker met potlood;

Vraag aan Filip de Pillecyn: Mr. De Pillecijn / wanneer stuurt ge mij de /
dagbladen waarin de teekeningen verschenen? / Oprechte groeten / Joz

